def find_clumps_data(genome, k, L, t):
    # Initializing an empty list to store all clumps.
    clumps_data = []  

    # Iterating over each possible window of length L in the genome sequence.
    for i in range(len(genome) - L + 1): 

        # Extracting the current window from the genome sequence.
        window = genome[i:i+L]  

        # Initializing a dictionary to store the frequency of each k-mer in the window.
        kmer_freq = {}  
        for j in range(len(window) - k + 1):
            # Extracting the current k-mer from the window sequence.
            kmer = window[j:j+k]
            kmer_freq[kmer] = kmer_freq.get(kmer, 0) + 1
        for kmer, count in kmer_freq.items():
            # Checking if the k-mer appears at least t times and is not already present.
            if count >= t and kmer not in clumps_data:
                clumps_data.append(kmer)
    return clumps_data

genome = ""
k, L, t = 9, 561, 19
clumps_data = find_clumps_data(genome, k, L, t)
output = ' '.join(clumps_data)
print(output)
